import styles from '../cssmodules/SidebarMod.module.css'
import {Route, BrowserRouter as Router, Routes, Link, NavLink} from 'react-router-dom'
import axios from 'axios'

const Sidebar = () =>{

async function countRecipesSeitan (){
    let amount = 0
    const data = fetch(`http://localhost:3000/category/seitan`)
    .then(res => {
       amount =  Object.keys(data).length;
       console.log(amount, "amount är här")
    })
    .catch(err=>{
        console.log(err)
    })
    return amount
}
countRecipesSeitan()

return(
    <div className={styles.sidewrapper}>
<Link to={`/category`} > 
<h1>Kategorier</h1>
</Link>

<NavLink to={`/category/seitan`} style={({isActive})=>({
    color: isActive ? '#145858' : 'black'

})}>
<h2>Seitan</h2>
</NavLink>

<NavLink to={`/category/pasta`}
style={({isActive})=>({
    color: isActive ? '#145858' : 'black'

})}
>
<h2>Pasta-rätter</h2>
</NavLink>

<NavLink to={encodeURI(`/category/röror`)} 
style={({isActive})=>({
    color: isActive ? '#145858' : 'black'

})} >
<h2>Röror</h2>
</NavLink>

<NavLink to={`/category/frukost`} style={({isActive})=>({
    color: isActive ? '#145858' : 'black'

})}>
<h2>Frukost</h2> 
</NavLink>

    </div>
)}
export default Sidebar
